import React, { Component } from "react";
import "../styles/About.css";
import banner from "../tree.png";
import sun from "../cornell_sun.jpg";

export default class Contact extends Component {
  render() {
    return (
      <div>
        <div className="about_title">
          <h1 className="about_title_text">About Me</h1>
          <div className="activities_container">
            <div className="education">
              <h2 className="about_title_subtext1">
                Currently, I am a senior majoring in English and Information
                Science at Cornell University's College of Arts &amp; Sciences.
              </h2>
              <img className="tree" src={banner} alt="" />
            </div>
            <div className="work">
              <h2 className="about_title_subtext1">
                As part of{" "}
                <a href="http://specials.cornellsun.com">
                  The Cornell Daily Sun's Web Team
                </a>{" "}
                , I help create experimental material and maintain the
                newspaper's website. I spend the most time working in React.
              </h2>
              <img className="sun" src={sun} alt="" />
            </div>
          </div>
        </div>
      </div>
    );
  }
}
